import {View, Text} from 'react-native';
import React from 'react';

function Graphs() {
    return (
    <View style={{alignItems:'center', justifyContent:'center', flex:1}}>
    <Text>Graphs</Text>
    </View>
    )
    }
    export default Graphs;
